/* eslint-disable func-style */
/* eslint-disable max-len */
/* eslint-disable require-jsdoc */
function addBlocks (Blockly) {
    const color = '#42CCFF';
    const dhtIconUrl = 'data:image/png;base64,';
    
    Blockly.Blocks.matrix_pin_init = {
        init: function () {
            this.jsonInit({
                message0: '%1',
                message1: Blockly.Msg.MATRIX_PIN_INIT,
                args0: [
                    {
                        type: 'field_image',
                        src: dhtIconUrl,
                        width: 50,
                        height: 27
                    }
                ],
                colour: color,
                extensions: ['shape_statement']
            });
        }
    };

    Blockly.Blocks.matrix_pin_display = {
        init: function () {
            this.jsonInit({
                message0: '%1',
                message1: Blockly.Msg.MATRIX_PIN_NUMBER,
                args0: [
                    {
                        type: 'field_image',
                        src: dhtIconUrl,
                        width: 50,
                        height: 27
                    }
                ],
                args1: [
                    {
                        type: 'field_dropdown',
                        name: 'photo',
                        options: [
                            ['0', 'data_0'],
                            ['1', 'data_1'],
                            ['2', 'data_2'],
                            ['3', 'data_3'],
                            ['4', 'data_4'],
                            ['5', 'data_5'],
                            ['6', 'data_6'],
                            ['7', 'data_7'],
                            ['8', 'data_8'],
                            ['9', 'data_9'],
                            ],
                    }
                ],
                colour: color,
                extensions: ['shape_statement']
            });
        }
    };


    return Blockly;
}

exports = addBlocks;
